snippet.textDisplay:
@noobz Dude, as a Christian, I would appreciate it if you instead of looking at scientific research as an affront to God look at it like a pursuit  of God. God is in possension of all types of knowledge, I think on this we can agree, the pursuit of knowledge and scientific discovery is exactly what God meant when He said that we were made in His image (at least this is my interpretation).

 I suggest you re-evaluate your interpretation of our scripture. I'm certain that the deceiver has made his way into your own life, as he has done to many others, he has diluted your own understanding of the word. It has been twisted by him into a way to keep you the furthest away from God as he can. 

I hope you know I truly mean it when I say that I pray for you. Have a blessed day. These ideas harm others, including those within our own faith.

